import React, { useState } from 'react';

function Register() {
  const [name, setName] = useState('');
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [confirmPassword, setConfirmPassword] = useState('');
  const [error, setError] = useState('');

  const handleRegister = (e) => {
    e.preventDefault();

    // Basic validation
    if (!name || !email || !password || !confirmPassword) {
      setError('All fields are required');
      return;
    }

    if (password !== confirmPassword) {
      setError('Passwords do not match');
      return;
    }

    // Registration logic here - call your backend API for registration
    console.log('Registering user with:', { name, email, password });

    // API call example (adjust for your actual backend):
    /*
    fetch('/api/register', {
      method: 'POST',
      headers: { 'Content-Type': 'application/json' },
      body: JSON.stringify({ name, email, password })
    })
    .then(response => response.json())
    .then(data => {
      if (data.success) {
        // Handle successful registration, e.g. redirect user
      } else {
        // Handle errors, display error message
      }
    })
    .catch(error => console.error('Error:', error));
    */
  };

  return (
    <form onSubmit={handleRegister}>
      {/* Display error messages */}
      {error && <div className="alert alert-danger" role="alert">{error}</div>}

      {/* Name input */}
      <div data-mdb-input-init className="form-outline mb-4">
        <input 
          type="text" 
          id="form3Example1" 
          className="form-control" 
          value={name}
          onChange={(e) => setName(e.target.value)}
          required
        />
        <label className="form-label" htmlFor="form3Example1">Full Name</label>
      </div>

      {/* Email input */}
      <div data-mdb-input-init className="form-outline mb-4">
        <input 
          type="email" 
          id="form3Example2" 
          className="form-control"
          value={email}
          onChange={(e) => setEmail(e.target.value)}
          required
        />
        <label className="form-label" htmlFor="form3Example2">Email address</label>
      </div>

      {/* Password input */}
      <div data-mdb-input-init className="form-outline mb-4">
        <input 
          type="password" 
          id="form3Example3" 
          className="form-control"
          value={password}
          onChange={(e) => setPassword(e.target.value)}
          required
        />
        <label className="form-label" htmlFor="form3Example3">Password</label>
      </div>

      {/* Confirm Password input */}
      <div data-mdb-input-init className="form-outline mb-4">
        <input 
          type="password" 
          id="form3Example4" 
          className="form-control"
          value={confirmPassword}
          onChange={(e) => setConfirmPassword(e.target.value)}
          required
        />
        <label className="form-label" htmlFor="form3Example4">Confirm Password</label>
      </div>

      {/* Submit button */}
      <button type="submit" className="btn btn-primary btn-block mb-4">Register</button>

      {/* Login and Social options */}
      <div className="text-center">
        <p>Already a member? <a href="#!">Login</a></p>
        <p>or register with:</p>
        <button type="button" className="btn btn-link btn-floating mx-1">
          <i className="fab fa-facebook-f"></i>
        </button>
        <button type="button" className="btn btn-link btn-floating mx-1">
          <i className="fab fa-google"></i>
        </button>
        <button type="button" className="btn btn-link btn-floating mx-1">
          <i className="fab fa-twitter"></i>
        </button>
        <button type="button" className="btn btn-link btn-floating mx-1">
          <i className="fab fa-github"></i>
        </button>
      </div>
    </form>
  );
}

export default Register;
